Let's discuss what the search algorithm will take as input and will give out as output. Input: the array element to be searched Output: Some(index) if element is present in the array None if element is not present in the array Now that we know what the algorithm expects and what we expect of it, let's understand how it will work The algorithm takes the array and the token (number to be searched) as input It compares the token with every element in the array If the token and element match, the algorithm returns the index of that element If the token doesn't match with any element i.e. it reaches the end of array, return None This is how a linear search algorithm works Now let's write a function that does the preceding: fn linear_search(array: Vec<i32>, token: i32) -> Option<usize> { for (idx, element) in array.into_iter().enumerate() { if element == token { return Some(idx); } } None
} Here, we created a function that accepts an array and the element to be searched and gives out the Option enum. Inside the function, a for loop iterates through every element in the array, that element is compared with given token for equality. If equal, the index of the element enclosed inside Some is returned. When the loop iterates through the array and cannot find the token, then the function returns None. Now that we have a function let's give it the inputs let array = vec![2, 9, 12, 18, 21, 26, 32, 37]; let token = 21; Note that the by default type of both these variables is Vec<i32> and i32 respectively. By setting up the variables and the outputs in the main function fn main() { let array = vec![2, 9, 12, 18, 21, 26, 32, 37]; let token = 21; let index = linear_search(array, token); match index { Some(x) => println!("The element is at index {x}."), None => println!("The element is not present in the array."), }
}

